public void putAll(Map m) {
  Iterator it = m.keySet().iterator();
  while (it.hasNext()) {
    Object key = it.next();
    Object val = m.get(key);
    this.put(key, val);
  }
}

public void putAll(Map m) {
  Iterator it = m.entrySet().iterator();
  while (it.hasNext()) {
    Map.Entry entry = (java.util.Map.Entry) it.next();
    this.put(entry.getKey(), entry.getValue());
  }
}

